{"site": "Code Review (Stack Exchange)", "question": {"title": "Request for feedback: My implementation of the A* algorithm", "body": "I'm looking for feedback on my implementation of the A* algorithm in Python. Are there any improvements I can make in terms of performance, readability, or Python best practices?

Here is my code:

```python
def a_star(start, goal, neighbors_fn, heuristic_fn):
    open_set = set([start])
    came_from = {}
    g_score = {start: 0}
    f_score = {start: heuristic_fn(start, goal)}

    while open_set:
        current = min(open_set, key=lambda x: f_score.get(x, float('inf')))
        if current == goal:
            path = []
            while current in came_from:
                path.append(current)
                current = came_from[current]
            path.append(start)
            return path[::-1]
        open_set.remove(current)
        for neighbor in neighbors_fn(current):
            tentative_g_score = g_score[current] + 1
            if tentative_g_score < g_score.get(neighbor, float('inf')):
                came_from[neighbor] = current
                g_score[neighbor] = tentative_g_score
                f_score[neighbor] = tentative_g_score + heuristic_fn(neighbor, goal)
                if neighbor not in open_set:
                    open_set.add(neighbor)
    return None
```

